import React, { useState, useEffect } from 'react';
import logo from '../assests/basilurlogo.png'; 
import { Link } from 'react-router-dom';

const AddFreightCoordinator = () => {
  const [freightAgents, setFreightAgents] = useState([]); 
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    contactNumber: '',
    password: '',
    selectedAgent: '',
  });
  const [errors, setErrors] = useState({}); 
  const [showErrorPopup, setShowErrorPopup] = useState(false); 
  const [showPassword, setShowPassword] = useState(false); 

  useEffect(() => {
    setFreightAgents([
      { id: '1', name: 'Agent 1' },
      { id: '2', name: 'Agent 2' },
      { id: '3', name: 'Agent 3' },
    ]);
  }, []);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const validateForm = () => {
    const newErrors = {};
    if (!formData.name) newErrors.name = 'Name is required';
    if (!formData.email) newErrors.email = 'Email is required';
    if (!formData.contactNumber) newErrors.contactNumber = 'Contact Number is required';
    if (!formData.selectedAgent) newErrors.selectedAgent = 'Freight Agent is required';
    if (!formData.password) newErrors.password = 'Password is required';

    return newErrors;
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const validationErrors = validateForm();

    if (Object.keys(validationErrors).length > 0) {
      setErrors(validationErrors);
      setShowErrorPopup(true);
    } else {
      alert(`Password for Freight Coordinator has been sent to ${formData.email}`);
    }
  };

  return (
    <div className="font-sans min-h-screen flex flex-col justify-between" style={{ backgroundColor: '#FFFFFF' }}>
      {/* Header */}
      <header
        className="flex items-center justify-center p-2 mx-auto"
        style={{
          backgroundColor: '#191919',
          color: '#FFFFFF',
          borderRadius: '30px',
          height: '50px',
          width: '85%',
          marginTop: '20px',
          boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
        }}
      >
        <img src={logo} alt="Logo" className="mr-4" style={{ width: '40px', height: '40px', objectFit: 'contain' }} />
        <h1 className="text-lg font-bold flex-1 text-center" style={{ color: '#FFFFFF' }}>
          Freight Allocation
        </h1>
      </header>

      {/* Main Content */}
      <main className="flex-1 flex justify-center items-center mt-8">
        <div
          className="p-6 rounded-lg shadow-lg"
          style={{
            background: '#FFFFFF',
            borderRadius: '16px',
            border: '1px solid rgba(25, 25, 25, 0.1)',
            boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
            width: '700px',
          }}
        >
          <h2 className="text-2xl mb-4 font-semibold" style={{ color: '#191919', textAlign: 'center' }}>
            Add Freight Coordinator
          </h2>
          <form className="flex flex-col" onSubmit={handleSubmit}>
            {/* Form Fields */}
            {/* (Other form fields like name, email, contactNumber, and selectedAgent) */}

            <div className="mb-3">
              <label htmlFor="password" className="block mb-1 text-sm" style={{ color: '#191919' }}>
                Password:
              </label>
              <div className="relative">
                <input
                  type={showPassword ? 'text' : 'password'}
                  id="password"
                  name="password"
                  className="w-full p-2 border rounded-md text-sm"
                  style={{
                    borderColor: '#191919',
                    backgroundColor: '#FFFFFF',
                    color: '#191919',
                  }}
                  value={formData.password}
                  onChange={handleInputChange}
                />
                <button
                  type="button"
                  onClick={() => setShowPassword(!showPassword)}
                  className="absolute right-3 top-1/2 transform -translate-y-1/2 text-xl"
                  style={{ color: '#191919' }}
                >
                  {showPassword ? (
                    <svg width="20" height="20" fill="none" xmlns="http://www.w3.org/2000/svg">
                      <path d="M16 8.848c-1.625 0-3.038 1.04-3.658 2.6C11.12 9.508 9.007 8 6 8c-3.315 0-6 2.686-6 6s2.685 6 6 6c2.542 0 4.773-1.554 5.732-3.707 1.91 1.407 4.222 2.707 6.268 3.415V11c0-3.314-2.685-6-6-6z" fill="#191919" />
                    </svg>
                  ) : (
                    <svg width="20" height="20" fill="none" xmlns="http://www.w3.org/2000/svg">
                      <path d="M10 3C5.583 3 2.25 6.25 2.25 9.75c0 3.312 2.834 6.27 6.75 7.76V17h-2v3h5v-3h-2v-3.489c1.48-.08 2.698-.697 3.392-1.545 1.85-2.424 2.65-5.062 2.65-7.963 0-3.333-2.834-6-6.75-6zm0 10c-2.334 0-4.5-1.666-4.5-3.75s2.166-3.75 4.5-3.75 4.5 1.666 4.5 3.75-2.166 3.75-4.5 3.75z" fill="#191919" />
                    </svg>
                  )}
                </button>
              </div>
              {errors.password && <p className="text-red-600 text-sm">{errors.password}</p>}
            </div>

            <button
              type="submit"
              className="p-3 rounded-md text-lg cursor-pointer border-2 w-full mt-4"
              style={{
                borderColor: '#FF4D00',
                backgroundColor: '#FF4D00',
                color: '#FFFFFF',
                transition: 'background-color 0.3s ease, color 0.3s ease',
              }}
            >
              Add Freight Coordinator
            </button>
          </form>
        </div>
      </main>

      {/* Error Popup */}
      {showErrorPopup && (
        <div className="fixed inset-0 bg-gray-700 bg-opacity-50 flex justify-center items-center z-50">
          <div className="bg-white p-6 rounded-lg shadow-lg w-96">
            <h2 className="text-xl font-semibold text-red-500">Error</h2>
            <div className="mt-2">
              <ul>
                {Object.values(errors).map((error, index) => (
                  <li key={index} className="text-sm text-red-600">{error}</li>
                ))}
              </ul>
            </div>
            <button
              onClick={() => setShowErrorPopup(false)}
              className="mt-4 p-2 rounded-md bg-red-500 text-white"
            >
              Close
            </button>
          </div>
        </div>
      )}

      {/* Footer */}
      <footer
        className="p-4 text-center"
        style={{
          backgroundColor: 'transparent',
          color: '#191919',
          fontSize: '14px',
          marginTop: '20px',
        }}
      >
        Â© {new Date().getFullYear()} Freight Allocation. All Rights Reserved.
      </footer>
    </div>
  );
};

export default AddFreightCoordinator;
